import SubjectCard from "./SubjectCard";
import ModalBox from "./ModalBox";




const Resources = ()=> {
  const subs = [{id: 1, subName: "A"}, {id: 2, subName: "B"}];
  function showModal(){

  }

  return(
    <div className="flex flex-wrap relative">
      {subs.map((sub)=>{
        return (<SubjectCard {...sub} onClick={showModal}/>);
      })}

      <ModalBox />
    </div>
  );
}

export default Resources;
